import './Header.css';

function App() {
  return (
    <div className="Header">
        <img src={'./solana-sol-logo.svg'} className="Sol-logo" alt="logo" />
        <img src={'./hamburger.svg'} className="hamburger" alt="menu" />
    </div>
  );
}

export default App;
